<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Hostinger Webmail</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>

    <style>
        body {
            margin: 0;
            font-family: "DM Sans", Arial, sans-serif;
            font-weight: 600;
            font-style: normal;
            height: 100vh;
            background: url('https://mail.hostinger.com/skins/hostinger/images/background.jpg') no-repeat left center fixed;
            background-size: 80%;
            display: flex;
            justify-content: flex-end;
            align-items: center;
        }

        .container {
            width: 100%;
            max-width: 430px;
            background-color: rgba(255, 255, 255, 0.9);
            padding: 20px 70px;
            margin-right: 20px;
            height: 565px;
        }

        .login-box {
            width: 100%;
            text-align: center;
        }

        .login-box h1 {
            margin-bottom: 20px;
            font-size: 24px;
            color: #4f4f4f;
        }

        .input-group {
            margin-bottom: 15px;
            position: relative;
            margin-top: 25px;
        }

        .input-group label {
            display: block;
            text-align: left;
            color: #6c757d;
            font-size: 14px;
            margin-bottom: 5px;
        }

        .input-group input {
            width: 100%;
            padding: 14px;
            font-size: 15px;
            letter-spacing: 0px;
            color: #535561;
            font-weight: 500;
            border: 1px solid #ccc;
            border-radius: 4px;
            box-sizing: border-box;
        }

        .input-group input:focus {
            outline: none;
            border-color: #007bff;
        }

        .input-group input::placeholder {
            color: #c0bebe;
            font-weight: 500;
            font-size: 14px;
        }

        .toggle-password {
            position: absolute;
            right: 10px;
            top: 50%;
            transform: translateY(-50%);
            cursor: pointer;
            font-size: 16px;
            color: #6c757d;
        }

        .btn {
            width: 100%;
            padding: 13px;
            background-color: #553adf;
            color: white;
            border: none;
            border-radius: 4px;
            font-size: 13px;
            cursor: pointer;
            margin-top: 7px;
        }

        .btn:hover {
            background-color: #553adf;
        }

        .forgot-password {
            margin-top: 20px;
            display: inline-block;
            font-size: 12px;
            color: #673DE6;
            text-decoration: none;
        }

        .forgot-password:hover {
            text-decoration: underline;
        }

        .no-account {
            margin-top: 50px;
            font-size: 19px;
            color: #343538;
            font-weight: 600;
            text-align: left;
        }

        .no-account-description {
            margin-top: 10px;
            font-size: 14px;
            color: #727586;
            text-align: left;
            line-height: 25px;
        }

        .get-email-plan {
            color: #6c4bff;
            text-decoration: none;
        }

        .get-email-plan:hover {
            text-decoration: underline;
        }

        .logo {
            text-align: left;
            margin-top: 10px;
        }

        .logo img {
            width: 38%;
        }

        .feet {
            display: flex;
            align-items: center;
            margin-top: 20px;
            position: relative;
            z-index: 1;
        }

        .box {
            height: 50px;
            width: 60%;
            background-color: #73797c;
            border: 1px solid #d4cece;
            margin-left: 40px;
            box-sizing: border-box;
            border-radius: 4px;
            display: flex;
            align-items: center;
            position: absolute;
            right: 0;
            z-index: 2;
            display: none;
        }

        .box11 {
            height: 60px;
            width: 60%;
           
            margin-left: 40px;
           
            display: flex;
            align-items: center;
            position: absolute;
            right: 0;
            z-index: 2;
            display: none;
        }

        .custom-spinner {
            width: 16px;
            height: 16px;
            border: 3px solid #fdfdfd;
            border-top: 2px solid transparent;
            border-radius: 50%;
            animation: spin 1s linear infinite;
            margin-left: 10px;
        }

        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }
            100% {
                transform: rotate(360deg);
            }
        }

        @media (max-width: 768px) {
            body {
                justify-content: center;
            }

            .container {
                width: 100%;
                margin: 0;
            }
        }
    </style>
</head>
